function eventChange(a){if(a.items===undefined){return}$.each(a.items,function(d,c){var b=$('[data-event="'+d+'"]');$.each(b,function(f,g){var e=$(g);$.each(c[$user.getBalanceType()],function(i,k){var j=e.find('td .ratio span[data-type="'+i+'"]');var m=j.closest(".ratio");var h=m.find("span.glyphicon");if(h.length==0){h=$("<span>",{"class":"glyphicon","data-toggle":"tooltip"});m.append(h)}h.removeClass("glyphicon-arrow-up glyphicon-arrow-down ratio-up ratio-down green red");if(k!=""){var n=parseFloat(j.text());var l;if(n<k){l=Math.floor(parseFloat((100*(k-n)).toFixed()))/100;h.addClass("glyphicon-arrow-up ratio-up green").attr("data-original-title","+"+l).attr("title","+"+l);m.addClass("ratio-green").removeClass("ratio-green",2000)}else{if(n>k){l=Math.floor(parseFloat((100*(n-k)).toFixed()))/100;h.addClass("glyphicon-arrow-down ratio-down red").attr("data-original-title","-"+l).attr("title","-"+l);m.addClass("ratio-red").removeClass("ratio-red",2000)}else{h.remove()}}}else{h.remove()}j.attr("data-value",k).text(k)})})})}function eventRemove(a){console.log("Remove",a);if(a.event_ids===undefined){return}$.each(a.event_ids,function(b,c){$('table[data-type="event-line"] tr[data-event="'+c+'"]').remove()})};